  const lbRegex = /\\([!\(\)\+\-\/0123456789=ABCDEFGHIJKLMNOPQRSTUVWXYZ\^_abcdefghijklmnopqrstuvwxyz]+)$/;
  const lbRegexSub = /\\_([\(\)\+\-0123456789=aehijklmnoprstuvx]+)$/;
  const lbRegexSup = /\\\^([!\(\)\+\-0123456789=ABDEGHIJKLMNOPRTUVWabcdefghijklmnoprstuvwxyz]+)$/;
  const insertText = ((event: any, start: number, end: number, s: string) => {
    const newValue = value.slice(0, start) + s + value.slice(end);
    event.target.value = newValue;
    event.target.selectionStart = start + s.length;
    event.target.selectionEnd = start + s.length;
    handleChange(event);
  })
  const handleTab = (event: any) => {
    const start = event.target.selectionStart;
    const end = event.target.selectionEnd;
    const w = event.target.value.slice(0, start);
    let m = w.match(lbRegex);
    if (start == end && m) {
      event.preventDefault();
      if (lbReplace[m[1]]) { // normal replace
        insertText(event, start-m[0].length, start, lbReplace[m[1]]);
        return;
      }
      m = w.match(lbRegexSub)
      if (m) { // replace with multiple indices
        const s = m[1].split("").map((x: string) => lbReplace["_"+x]).join("");
        insertText(event, start-m[0].length, start, s);
        return;
      }
      m = w.match(lbRegexSup)
      if (m) { // replace with multiple exponents
        const s = m[1].split("").map((x: string) => lbReplace["^"+x]).join("");
        insertText(event, start-m[0].length, start, s);
        return;
      }
    }
    else if (tabBehaviour === 'insert') {
      event.preventDefault();
      insertText(event, start, end, '\t')
      return;
    }
    onKeyDown(event);
  }
  const handleKeyDown = (event: any) => {
    if (!readOnly && !event.metaKey && !event.altKey && !event.ctrlKey && event.key === 'Tab') {
      handleTab(event);
    }
    else {
      onKeyDown(event);
    }
  }
  return (
    <>
      <textarea
        id={id}
        value={value}
        readOnly={readOnly}
        onChange={handleChange}
        onKeyDown={handleKeyDown}
        style={{ height: `max(${height + 2 * 8}px, ${(bigTextBoxes ? 3 : 1) * 24 + 2 * 8}px)` }}
        className="block w-full my-4 p-2 rounded bg-gray-100 dark:bg-gray-800 font-mono text-base resize-none cursor-text focus:outline-none focus:ring transition"
        autoComplete="off"
        autoCorrect="off"
        autoCapitalize="none"
        spellCheck={false}
      />
    </>
  );
